import React from "react";
import Sdata from "./Sdata";
import Card from "./Card";
import Image from "./Img";




const Netflix =()=>{
    return(
    <Card
                key={Sdata[1].id}
                imgsrc={Sdata[1].imgsrc}
                cardTitle={Sdata[1].cardTitle}
                link={Sdata[1].link}
            />
    )
}

export default Netflix;
